// import httpClient from '../http-common';
import axios from "axios";

const getAll = () =>{
    return axios.get('http://localhost:8080/api/v1/listStudent');

}

const create = (data) =>{
    return axios.post('http://localhost:8080/api/v1/addStudent', data);
}

const get = (id) =>{
    return axios.get('http://localhost:8080/api/v1/getStudent/${id}');
}

const update = (data)=>{
    return axios.put('http://localhost:8080/api/v1/update', data);
}

const remove = (id) =>{
    return axios.delete('http://localhost:8080/api/v1/delete/${id}', data);
}

export default {getAll, create, get, update}
